window.bookSummaryJSON = "<p>You have glioblastoma, an incurable brain cancer, and have less than a month to live. What price would you be willing to pay for a cure?&nbsp;</p> <p>Any price? Are you sure?&nbsp;</p> <p>Would it be worth agreeing to join an alien nation offering a cure but without any of the messy details like:</p> <p></p> <ul> <li>Who and what are the aliens</li> <li>Proof they can cure you</li> <li>Why they want people from Earth</li> <li>The alien's specific needs</li> <li>What they expect from those they cure</li> </ul> <p>And knowing you will never see Earth again.</p> <p>Kayla, a 17-year-old teenager, and others with an assortment of lethal medical conditions are about to find out the price of life.</p>"; 
